DROP TABLE IF EXISTS `invTypes`;
CREATE TABLE `invTypes` (
  `typeID` smallint(6) NOT NULL,
  `groupID` smallint(6) default NULL,
  `typeName` varchar(100) default NULL,
  `description` varchar(3000) default NULL,
  `graphicID` smallint(6) default NULL,
  `radius` double default NULL,
  `mass` double default NULL,
  `volume` double default NULL,
  `capacity` double default NULL,
  `portionSize` int(11) default NULL,
  `raceID` tinyint(3) unsigned default NULL,
  `basePrice` double default NULL,
  `published` tinyint(1) default NULL,
  `marketGroupID` smallint(6) default NULL,
  `chanceOfDuplicating` double default NULL,
  PRIMARY KEY  (`typeID`),
  KEY `invTypes_IX_Group` (`groupID`),
  KEY `graphicID` (`graphicID`),
  KEY `raceID` (`raceID`),
  KEY `marketGroupID` (`marketGroupID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

INSERT INTO `invTypes` VALUES ('34','18','Tritanium','The main building block in space structures. A very hard, yet bendable metal. Cannot be used in human habitats due to its instability at atmospheric temperatures. Very common throughout the world.','399','0','0','0.01','0','1',NULL,'2','1','18','0'),('35','18','Pyerite','A soft crystal-like mineral with a very distinguishing orange glow as if on fire. Used as conduit and in the bio-chemical industry. Commonly found in many asteroid-ore types.','1203','0','0','0.01','0','1',NULL,'8','1','18','0'),('36','18','Mexallon','Very flexible metallic mineral, dull to bright silvery green in color. Can be mixed with tritanium to make extremely hard alloys or it can be used by itself for various purposes. Fairly common in most regions.','401','0','0','0.01','0','1',NULL,'32','1','18','0'),('37','18','Isogen','Light-bluish crystal, formed by intense pressure deep within large asteroids and moons. Used in electronic and weapon manufacturing. Only found in abundance in a few areas. ','402','0','0','0.01','0','1',NULL,'128','1','18','0'),('38','18','Nocxium','A highly volatile mineral only formed during supernovas, thus severely limiting the extent of its distribution. Vital ingredient in capsule production, making it very coveted.','1201','0','0','0.01','0','1',NULL,'512','1','18','0'),('39','18','Zydrine','Only found in huge geodes; rocks on the outside with crystal-like quartz on the inside. The rarest and most precious of these geodes are those that contain the dark green zydrine within. Very rare and very expensive.','404','0','0','0.01','0','1',NULL,'2048','1','18','0'),('40','18','Megacyte','An extremely rare mineral found in comets and very occasionally in asteroids that have traveled through gas clouds. Has unique explosive traits that make it very valuable in the armaments industry. ','1202','0','0','0.01','0','1',NULL,'8192','1','18','0'),('11399','18','Morphite','Morphite is a highly unorthodox mineral that can only be found in the hard-to-get Mercoxit ore. It is hard to use Morphite as a basic building material, but when it is joined with existing structures it can enhance the performance and durability manifold. This astounding quality makes this the material responsible for ushering in a new age in technology breakthroughs. ','2103','0','0','0.01','0','1',NULL,'32768','1','18','0'),('27029','18','Chalcopyrite','This mineral is of interest only to civilian and rookie pilot factory production.','399','0','0','0.01','0','1',NULL,'2','0',NULL,'0'),('16272','423','Heavy Water','Dideuterium oxide. Water with significant nuclear properties which make it extremely effective as a neutron moderator in various types of power reactors. One of the materials required to keep Control Towers online.','2698','0','0','0.4','0','1',NULL,'1000','1','476','0'),('16273','423','Liquid Ozone','Liquid Ozone is used as a cleaning and disinfectant substance, and plays a vital role in ensuring the smooth day-to-day operation of a starbase. One of the materials required to keep Control Towers online.','2697','0','0','0.4','0','1',NULL,'1000','1','476','0'),('16274','423','Helium Isotopes','The Helium-3 isotope is extremely sought-after for use in fusion processes, and also has various applications in the fields of cryogenics and machine cooling. One of the materials required to keep Amarr Control Towers online.','2699','0','0','0.15','0','1',NULL,'1000','1','476','0'),('16275','423','Strontium Clathrates','An unstable compound of strontium molecules encased in the crystal structure of water. When fed to a Control Tower\'s force field generator, these clathrates bond with the molecules already in place in the field to create a nigh-invulnerable barrier of energy. A necessary ingredient for Control Towers to go into reinforced mode.','2696','0','0','3','0','1',NULL,'1000','1','476','0'),('17887','423','Oxygen Isotopes','Stable O-16 isotopes, crucial for maintenance of Gallente Control Towers.','2701','0','0','0.15','0','1',NULL,'0','1','476','0'),('17888','423','Nitrogen Isotopes','Nitrogen-14 is a stable, non-radioactive isotope, crucial for maintenance of Caldari Control Towers.','2702','0','0','0.15','0','1',NULL,'0','1','476','0'),('17889','423','Hydrogen Isotopes','Hydrogen-2, otherwise known as Deuterium. Due to its unique properties the hydrogen-2 isotope is able to very effectively fuse with other atoms. Useful in a variety of nuclear scenarios, and an essential material for the maintenance of Minmatar Control Towers.','2700','0','0','0.15','0','1',NULL,'0','1','476','0'),('16262','465','Clear Icicle','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. These crystalline formations can be found scattered around many an ice field, and are known as the universe\'s primary source of helium isotopes.','2556','1','1000','1000','0','1',NULL,'376000','1','493','0'),('16263','465','Glacial Mass','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. Glacial masses are known to contain hydrogen isotopes in abundance, in addition to smatterings of heavy water and liquid ozone.','2555','1','1000','1000','0','1',NULL,'76000','1','493','0'),('16264','465','Blue Ice','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. Due to its unique chemical composition and the circumstances under which it forms, blue ice contains more oxygen isotopes than any other ice asteroid.','2554','1','1000','1000','0','1',NULL,'76000','1','493','0'),('16265','465','White Glaze','When star fusion processes occur near high concentrations of silicate dust, such as those found in interstellar ice fields, the substance known as White Glaze is formed. White Glaze is extremely high in nitrogen-14 and other stable nitrogen isotopes, and is thus a necessity for the sustained operation of certain kinds of control tower.','2561','1','1000','1000','0','1',NULL,'76000','1','493','0'),('16266','465','Glare crust','In areas with high concentrations of electromagnetic activity, ice formations such as this one, containing large amounts of heavy water and liquid ozone, are spontaneously formed during times of great electric flux. Glare crust also contains a small amount of strontium clathrates.','2559','1','1000','1000','0','1',NULL,'1525000','1','493','0'),('16267','465','Dark Glitter','Dark glitter is one of the rarest of the interstellar ices, formed only in areas with large amounts of residual electrical current. Little is known about the exact way in which it comes into being; the staggering amount of liquid ozone to be found inside one of these rocks makes it an intriguing mystery for stellar physicists and chemists alike. In addition, it contains large amounts of heavy water and a decent measure of strontium clathrates.','2557','1','1000','1000','0','1',NULL,'1550000','1','493','0'),('16268','465','Gelidus','Fairly rare and very valuable, Gelidus-type ice formations are a large-scale source of strontium clathrates, one of the rarest ice solids found in the universe, in addition to which they contain unusually large concentrations of heavy water and liquid ozone.','2558','1','1000','1000','0','1',NULL,'825000','1','493','0'),('16269','465','Krystallos','The universe\'s richest known source of strontium clathrates, Krystallos ice formations are formed only in areas where a very particular combination of environmental factors are at play. Krystallos compounds also include quite a bit of liquid ozone.','2560','1','1000','1000','0','1',NULL,'450000','1','493','0'),('17975','465','Thick Blue Ice','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. Due to its unique chemical composition and the circumstances under which it forms, blue ice will, under normal circumstances, contain more oxygen isotopes than any other ice asteroid. This particular formation is an old one and therefore contains even more than its less mature siblings.\n','2554','1','1000','1000','0','1',NULL,'116000','1','493','0'),('17976','465','Pristine White Glaze','When star fusion processes occur near high concentrations of silicate dust, such as those found in interstellar ice fields, the substance known as White Glaze is formed. While White Glaze generally is extremely high in nitrogen-14 and other stable nitrogen isotopes, a few rare fragments, such as this one, have stayed free of radioactive contaminants and are thus richer in isotopes than their more impure counterparts.\n','2561','1','1000','1000','0','1',NULL,'116000','1','493','0'),('17977','465','Smooth Glacial Mass','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. Glacial masses are known to contain hydrogen isotopes in abundance, but the high surface diffusion on this particular mass means it has considerably more than its coarser counterparts.\n','2555','1','1000','1000','0','1',NULL,'116000','1','493','0'),('17978','465','Enriched Clear Icicle','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. These crystalline formations can be found scattered around many an ice field and are known as the universe\'s primary source of helium isotopes. Due to environmental factors, this fragment\'s isotope deposits have become even richer than its regular counterparts\'.','2556','1','1000','1000','0','1',NULL,'466000','1','493','0'),('28433','465','Compressed Blue Ice','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. Due to its unique chemical composition and the circumstances under which it forms, blue ice contains more oxygen isotopes than any other ice asteroid.\n\nThis ore has been compressed into a much more dense version.','3327','1','1000','100','0','1',NULL,'76000','1','493','0'),('28434','465','Compressed Clear Icicle','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. These crystalline formations can be found scattered around many an ice field, and are known as the universe\'s primary source of helium isotopes.\n\nThis ore has been compressed into a much more dense version.','3324','1','1000','100','0','1',NULL,'376000','1','493','0'),('28435','465','Compressed Dark Glitter','Dark glitter is one of the rarest of the interstellar ices, formed only in areas with large amounts of residual electrical current. Little is known about the exact way in which it comes into being; the staggering amount of liquid ozone to be found inside one of these rocks makes it an intriguing mystery for stellar physicists and chemists alike. In addition, it contains large amounts of heavy water and a decent measure of strontium clathrates.\n\nThis ore has been compressed into a much more dense version.','3325','1','1000','100','0','1',NULL,'1550000','1','493','0'),('28436','465','Compressed Enriched Clear Icicle','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. These crystalline formations can be found scattered around many an ice field and are known as the universe\'s primary source of helium isotopes. Due to environmental factors, this fragment\'s isotope deposits have become even richer than its regular counterparts\'.\n\nThis ore has been compressed into a much more dense version.','3324','1','1000','100','0','1',NULL,'466000','1','493','0'),('28437','465','Compressed Gelidus','Fairly rare and very valuable, Gelidus-type ice formations are a large-scale source of strontium clathrates, one of the rarest ice solids found in the universe, in addition to which they contain unusually large concentrations of heavy water and liquid ozone.\n\nThis ore has been compressed into a much more dense version.','3328','1','1000','100','0','1',NULL,'825000','1','493','0'),('28438','465','Compressed Glacial Mass','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. Glacial masses are known to contain hydrogen isotopes in abundance, in addition to smatterings of heavy water and liquid ozone.\n\nThis ore has been compressed into a much more dense version.','3326','1','1000','100','0','1',NULL,'76000','1','493','0'),('28439','465','Compressed Glare Crust','In areas with high concentrations of electromagnetic activity, ice formations such as this one, containing large amounts of heavy water and liquid ozone, are spontaneously formed during times of great electric flux. Glare crust also contains a small amount of strontium clathrates.\n\nThis ore has been compressed into a much more dense version.','3323','1','1000','100','0','1',NULL,'1525000','1','493','0'),('28440','465','Compressed Krystallos','The universe\'s richest known source of strontium clathrates, Krystallos ice formations are formed only in areas where a very particular combination of environmental factors are at play. Krystallos compounds also include quite a bit of liquid ozone.\n\nThis ore has been compressed into a much more dense version.','3330','1','1000','100','0','1',NULL,'450000','1','493','0'),('28441','465','Compressed Pristine White Glaze','When star fusion processes occur near high concentrations of silicate dust, such as those found in interstellar ice fields, the substance known as White Glaze is formed. While White Glaze generally is extremely high in nitrogen-14 and other stable nitrogen isotopes, a few rare fragments, such as this one, have stayed free of radioactive contaminants and are thus richer in isotopes than their more impure counterparts.\n\nThis ore has been compressed into a much more dense version.\n','3329','1','1000','100','0','1',NULL,'116000','1','493','0'),('28442','465','Compressed Smooth Glacial Mass','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. Glacial masses are known to contain hydrogen isotopes in abundance, but the high surface diffusion on this particular mass means it has considerably more than its coarser counterparts.\n\nThis ore has been compressed into a much more dense version.','3326','1','1000','100','0','1',NULL,'116000','1','493','0'),('28443','465','Compressed Thick Blue Ice','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. Due to its unique chemical composition and the circumstances under which it forms, blue ice will, under normal circumstances, contain more oxygen isotopes than any other ice asteroid. This particular formation is an old one and therefore contains even more than its less mature siblings.\n\nThis ore has been compressed into a much more dense version.\n','3327','1','1000','100','0','1',NULL,'116000','1','493','0'),('28444','465','Compressed White Glaze','When star fusion processes occur near high concentrations of silicate dust, such as those found in interstellar ice fields, the substance known as White Glaze is formed. White Glaze is extremely high in nitrogen-14 and other stable nitrogen isotopes, and is thus a necessity for the sustained operation of certain kinds of control tower.\n\nThis ore has been compressed into a much more dense version.','3329','1','1000','100','0','1',NULL,'76000','1','493','0'),('28627','465','Azure Ice','Interstellar ices are formed by the accretion of gas molecules onto silicate dust particles. Azure ice forms under the same circumstances as \"blue ice,\" but due to its slightly different chemical composition, it contains substantially fewer oxygen isotopes by volume than its blue cousin, rendering it a \"lesser\" material.','2554','1','1000','1000','0','1',NULL,'0','1',NULL,'0'),('28628','465','Crystalline Icicle','Interstellar ices are formed by accretion of gas molecules onto silicate dust particles. These crystalline formations can be found scattered around many stellar ice fields, but \"crystalline icicles\" have a very low isotope count compared to other minable ices, making it relatively worthless. It\'s simply \"space ice.\" ','2556','1','1000','1000','0','1',NULL,'0','1',NULL,'0'),('25268','711