n of ultra-hard metal alloys and heat-resistant weapons systems.\n\nAlthough all of the empires have developed a rudimentary understanding of how to manipulate fullerene, only the Jovians are known to have mastered the science. This has allowed them to maintain a significant technological advantage over other races in many crucial areas. ','3225','100','0','10','0','1',NULL,'0','1','1145','0'),('30377','711','Fullerite-C320','Fullerite is the solid-state manifestation of fullerene molecules and can be found naturally occurring within interstellar gas clouds. Fullerites are coveted for the unique structural properties that make them some of the most useful materials known to humankind. Fullerene-based technology has applications in electronics, propulsion and engineering as well as the construction of ultra-hard metal alloys and heat-resistant weapons systems.\n\nAlthough all of the empires have developed a rudimentary understanding of how to manipulate fullerene, only the Jovians are known to have mastered the science. This has allowed them to maintain a significant technological advantage over other races in many crucial areas. ','3224','100','0','10','0','1',NULL,'0','1','1145','0'),('30378','711','Fullerite-C540','Fullerite is the solid-state manifestation of fullerene molecules and can be found naturally occurring within interstellar gas clouds. Fullerites are coveted for the unique structural properties that make them some of the most useful materials known to humankind. Fullerene-based technology has applications in electronics, propulsion and engineering as well as the construction of ultra-hard metal alloys and heat-resistant weapons systems.\n\nAlthough all of the empires have developed a rudimentary understanding of how to manipulate fullerene, only the Jovians are known to have mastered the science. This has allowed them to maintain a significant technological advantage over other races in many crucial areas. ','3224','100','0','10','0','1',NULL,'0','1','1145','0'),('25588','754','Scorched Telemetry Processor','An expert system used in the construction of missile launchers. This one has been damaged by fire or an explosion.','3256','0','0','0.01','0','1',NULL,'0','1','942','0'),('25589','754','Malfunctioning Shield Emitter','This Shield Emitter, while not being totally out of commission doesn\'t seem to be living up to its full potential. With some tender loving care the parts could be put to good use. ','3252','0','0','0.01','0','1',NULL,'0','1','942','0'),('25590','754','Contaminated Nanite Compound','A soup of nanite assemblers typically used in armor manufacturing processes. This compound needs to go through purification before it\'s of use again.','3250','0','0','0.01','0','1',NULL,'0','1','942','0'),('25591','754','Contaminated Lorentz Fluid','So named for its myriad electrodynamic properties, Lorentz Fluid exhibits strong conductivity with extreme resistance to heat. ','3250','0','0','0.01','0','1',NULL,'0','1','942','0'),('25592','754','Defective Current Pump','Used to transfer energy from a ships capacitor to a laser gain medium. The mechanism on this device is in need of repair.','3254','0','0','0.01','0','1',NULL,'0','1','942','0'),('25593','754','Smashed Trigger Unit','This Thermonuclear Trigger Unit while smashed still seems to have it\'s nuclei containment field intact and the plasma seems to be near thermal equilibrium. It would be a shame to waste this unit just because of its cosmetic damage.','3262','0','0','0.01','0','1',NULL,'0','1','942','0'),('25594','754','Tangled Power Conduit','Power Conduit runs through ships delivering energy like arteries deliver blood through a body. Large ships can have hundreds of miles of conduit. This conduit is tangled and knotted as it seems to have gone through some sort of catastrophe.','3248','0','0','0.01','0','1',NULL,'0','1','942','0'),('25595','754','Alloyed Tritanium Bar','Tritanium based alloy for use in applications requiring extremely high strength and temperature resistance. Some examples are thruster mounts or afterburner nozzles.','3260','0','0','0.01','0','1',NULL,'0','1','942','0'),('25596','754','Broken Drone Transceiver','A multifunction chip with digital modulator and oscillator utilized in drone communication hardware. This one looks broken.','3256','0','0','0.01','0','1',NULL,'0','1','942','0'),('25597','754','Damaged Artificial Neural Network','ANNs preside over a starship\'s various electronics subsystems and keep everything in working order, rerouting power and processing when systems are damaged or go offline. This ANN is damaged but doesn\'t seem to be a total loss. ','3256','0','0','0.01','0','1',NULL,'0','1','942','0'),('25598','754','Tripped Power Circuit','A closed loop electrical network with redundant autonomous switchgear. This unit has all of its breakers tripped but isn\'t beyond repair. ','3264','0','0','0.01','0','1',NULL,'0','1','942','0'),('25599','754','Charred Micro Circuit','Micro Circuits are one of the most common electronics components seen in use. This one has seen better days but could still be of some use.','3264','0','0','0.01','0','1',NULL,'0','1','942','0'),('25600','754','Burned Logic Circuit','Autonomous field programmable holographic signal processor with embedded holographic data storage. Used in most modern computers, the ubiquitous AFPHSPEHDS is colloquially known as the \"Aphid\". This name leads of course to many bad puns about bugs in the system. ','3264','0','0','0.01','0','1',NULL,'0','1','942','0'),('25601','754','Fried Interface Circuit','Interface Circuits are common building blocks of starship subsystems. This one seems a little worse for wear but might be useful for something with a little ingenuity. ','3264','0','0','0.01','0','1',NULL,'0','1','942','0'),('25602','754','Thruster Console','The control unit for a starships thrusters.','3256','0','0','0.01','0','1',NULL,'0','1','942','0'),('25603','754','Melted Capacitor Console','A slightly damaged but still seemingly usable capacitor console. Capacitor consoles are a necessary component of starship capacitor units.','3256','0','0','0.01','0','1',NULL,'0','1','942','0'),('25604','754','Conductive Polymer','An extremely conductive synthetic compound of high molecular weight. Used in the construction of electronics.','3246','0','0','0.01','0','1',NULL,'0','1','942','0'),('25605','754','Armor Plates','Typical armor plating','3258','0','0','0.01','0','1',NULL,'0','1','942','0'),('25606','754','Ward Console','The control unit for a starships shield systems.','3256','0','0','0.01','0','1',NULL,'0','1','942','0'),('25607','754','Telemetry Processor','An expert system used in the construction of missile launchers.','3257','0','0','0.01','0','1',NULL,'0','1','942','0'),('25608','754','Intact Shield Emitter','An intact shield emitter component.','3253','0','0','0.01','0','1',NULL,'0','1','942','0'),('25609','754','Nanite Compound','A soup of nanite assemblers typically used in armor manufacturing processes.','3251','0','0','0.01','0','1',NULL,'0','1','942','0'),('25610','754','Lorentz Fluid','So named for its myriad electrodynamic properties, Lorentz Fluid exhibits strong conductivity with extreme resistance to heat.','3251','0','0','0.01','0','1',NULL,'0','1','942','0'),('25611','754','Current Pump','Used to transfer energy from a ships capacitor to a laser gain medium.','3255','0','0','0.01','0','1',NULL,'0','1','942','0'),('25612','754','Trigger Unit','A perfectly functioning cannon trigger unit.','3263','0','0','0.01','0','1',NULL,'0','1','942','0'),('25613','754','Power Conduit','Power Conduit runs through ships delivering energy like arteries deliver blood through a body. Large ships can have hundreds of miles of conduit.','3249','0','0','0.01','0','1',NULL,'0','1','942','0'),('25614','754','Single-crystal Superalloy I-beam','An intact section of tritanium based single-crystal alloy i-beam for use in applications requiring extremely high strength and temperature resistance. Some examples are thruster mounts or afterburner nozzles.','3261','0','0','0.01','0','1',NULL,'0','1','942','0'),('25615','754','Drone Transceiver','Multifunction chip with digital modulator and oscillator.','3257','0','0','0.01','0','1',NULL,'0','1','942','0'),('25616','754','Artificial Neural Network','ANNs preside over a starship\'s various electronics subsystems and keep everything in working order, rerouting power and processing when systems are damaged or go offline. ','3257','0','0','0.01','0','1',NULL,'0','1','942','0'),('25617','754','Power Circuit','Your average run-of-the-mill closed loop electrical network with redundant autonomous switchgear.','3265','0','0','0.01','0','1',NULL,'0','1','942','0'),('25618','754','Micro Circuit','The Micro Circuit is one of the most common electronics components seen in use.','3265','0','0','0.01','0','1',NULL,'0','1','942','0'),('25619','754','Logic Circuit','An \"Aphid\" logic circuit. The nickname is derived from the unfortunate acronym of autonomous field programmable holographic signal processor with embedded holographic data storage.','3265','0','0','0.01','0','1',NULL,'0','1','942','0'),('25620','754','Interface Circuit','Interface Circuits are common building blocks of starship subsystems.','3265','0','0','0.01','0','1',NULL,'0','1','942','0'),('25621','754','Impetus Console','A more advanced version of the common Thruster Console.','3257','0','0','0.01','0','1',NULL,'0','1','942','0'),('25622','754','Capacitor Console','Capacitor consoles are a necessary component of starship capacitor units.','3257','0','0','0.01','0','1',NULL,'0','1','942','0'),('25623','754','Conductive Thermoplastic','Used to build Tech II ship upgrades','3247','0','0','0.01','0','1',NULL,'0','1','942','0'),('25624','754','Intact Armor Plates','Used to build Tech II ship upgrades','3259','0','0','0.01','0','1',NULL,'0','1','942','0'),('25625','754','Enhanced Ward Console','A control unit for Tech II shield systems.','3257','0','0','0.01','0','1',NULL,'0','1','942','0'),('30018','966','Fused Nanomechanical Engines','The beating heart of the Sleeper\'s automated drones, these tiny engines count in the billions. When fully intact, they deliver levels of power efficiency unrivaled by current technology. Unfortunately, whenever a Sleeper drone goes down, these engines are the first to go with them, making it difficult to emulate their functionality without the addition of other components.','3726','0','0','0.01','0','1',NULL,'0','1','1148','0'),('30019','966','Powdered C-540 Graphite','This white, dusty substance was extracted from the center of high impact craters in the Sleeper drone\'s armor. When mixed with other materials it forms a stiff resin that can either be used to hold various pieces of hull sheets together or to coat them for additional protection against radiation and heat.','3727','0','0','0.01','0','1',NULL,'0','1','1148','0'),('30021','966','Modified Fluid Router','The backbones of communication across New Eden, fluid routers play a crucial role in all faster-than-light (FTL) transmissions. The Sleeper drones have been equipped with much the same communications equipment as contemporary starships. The only major difference observable with the Sleeper Fluid Routers is in the way transmissions are translated. The drones must be talking in their own proprietary language.','3723','0','0','0.01','0','1',NULL,'0','1','1148','0'),('30022','966','Heuristic Selfassemblers','These advanced nanoassemblers appear to be able to change their molecular structure on the fly, adapting to incoming damage. Without any understanding of how to properly operate them however, they only offer their default formations. Even in such a state, they add a significant amount of resilience to armor plating.','3725','0','0','0.01','0','1',NULL,'0','1','1148','0'),('30024','966','Cartesian Temporal Coordinator','At first glance this coordinator appears to be a common enough piece of equipment, albeit an odd one to be found inside a drone. Designed to plot various points in time across a potentially infinite period, these devices are often used for scientific calculations.\n\nFor some unknown reason, this particular coordinator is configured to synchronize its processing speed in time with the distance travelled between two points. What purpose this serves remains a mystery, but the objects basic functionality can be reconfigured. With the addition of a few other components, it would allow electronics systems to more easily withstand the interference from subspace distortion. ','3722','0','0','0.01','0','1',NULL,'0','1','1148','0'),('30248','966','Emergent Combat Analyzer','This combat analyzer appears to use the same fundamental programming as standard Empire-issue technology, although it operates at a much higher level of efficiency. These devices are typically employed in fleets where they provide predictive analyses of complex battle scenarios and supplement other combat electronics that handle smaller elements.\n\nCombat analyzers are best employed in tasks such as calculating a fleets success rate, running comparative analyses between fleets and other similarly abstract problem-solving tasks requiring higher levels of heuristic programming. Even though the equipment has been badly damaged, the core functionality remains intact. With a skilled programmer and a talented mechanic, it could be re-integrated into a starship.','3729','0','0','0.01','0','1',NULL,'0','1','1148','0'),('30251','966','Neurovisual Input Matrix','Used in conjunction with other equipment inside the capsule, neurovisual input matrices serve the vital function of translating external stimuli into visual data. Ship identifier tags, hostile threat indicators and tactical overlay interfaces are all typical examples of N.I.M at work. The Sleeper variants of these matrices are not substantively different from contemporary devices, needing only a few supplemental components and some minor reprogramming before they can operate in much the same way. The only major deviation is in the energy efficiency. The Sleeper device is almost a thousand times less demanding on a ships power core.','3723','0','0','0.01','0','1',NULL,'0','1','1148','0'),('30252','966','Thermoelectric Catalysts','These tiny nanomachines have been injected into the thermoelectric power core at the heart of the Sleeper drone. Inside each one is a small array of chemicals and components, all of which play a role in producing the often violent chemical reactions that provide power to the drones. Only the most advanced Sleeper drones are known to have had their power cores enhanced in this way.\n\nEven though they all share the same fundamental role, thousands of minor variations in the machines that have emerged after millennia of use, as they adapted to the minute changes in chemical composition and electrical flux. How exactly they came to do this remains a mystery, but it is clear that the current product is the result of countless iterations. \n\nAlthough salvaged easily enough, they have been built from the ground up to be integrated into other Sleeper technology. Trying to enhance any engineering systems outside of the Sleepers own thermoelectric power cores with the current level of technology would represent an impossible reverse-engineering task.','2889','0','0','0.01','0','1',NULL,'0','1','1148','0'),('30254','966','Electromechanical Hull Sheeting','These ultra-thin nanoplastic sheets are resilient enough to survive the explosion of the Sleeper drones that carry them. The molecular-level circuitry inside them can be encased in layers of protective fullerene alloys that are billions of times their size, allowing electronics systems to be safely embedded just beneath the armor surface.','3730','0','0','0.01','0','1',NULL,'0','1','1148','0'),('30258','966','Resonance Calibration Matrix','RCM play an important role in stabilizing a ships alignment prior to, and in the first moments of, interstellar warp. The Sleeper drone RCM system works in an entirely different manner to contemporary Empire-based technology and yet the angles of alignment produced by their final calculations are always identical. Even though their inner workings remain a mystery, the matrices operate in a predictable and reliable enough fashion to form the basis of a new, slightly more efficient jump drive.','3733','0','0','0.01','0','1',NULL,'0','1','1148','0'),('30259','966','Melted Nanoribbons','Most of these tiny circuits have fused together from the heat and force of the Sleeper drone\'s explosion. The detonation of the drone\'s power core must have been immense to have had such an effect on these resilient nanostructures.','3724','0','0','0.01','0','1',NULL,'0','1','1148','0'),('30268','966','Jump Drive Control Nexus','Barely salvageable from the wreck of a Sleeper drone, this device could have been something much more impressive when it was fully functional. In its current state it is almost unrecognizable, having been scratched, burned and even chemically melted. It looks like it was housed next to the drone\'s power core, which would explain the extreme heat damage it suffered when the drone exploded.\n\nStranger yet, it almost seems as if it was lined with some kind of triggered-release corrosive. The self-destruct mechanism  if thats even what it was  only caused so much damage, and the acid didn\'t burn cleanly through the center of the drive. \n\nEven as a shadow of its former self, it can be combined with other components to form a fully functional warp drive. Being capable of this, even in such a bad state, strongly suggests that the device was capable of other types of more advanced interstellar travel. Why a Sleeper drone was equipped with this level of technology remains a mystery.','2889','0','0','0.01','0','1',NULL,'0','1','1148','0'),('30269','966','Defensive Control Node','A rudimentary analysis of this device reveals an amazingly broad potential for the manipulation of nanomachines, allowing the user to reprogram them for numerous roles. The Sleeper defensive systems were so modular that, even though this particular node was designed to coordinate armor-repairing nanoassemblers, it could just as easily be reconfigured for shield defense.','2889','0','0','0.01','0','1',NULL,'0','1','1148','0'),('30270','966','Central System Controller','Still fully intact and operational, this device stands as a testament to the ancient Sleeper\'s impressive scientific achievements. Although thousands of years old, the technology inside it is not only comparable to modern electronic designs, but in some cases even exceeds it.\n\nCentral system controllers lie at the heart of a starships electronics systems. They are responsible for coordinating the flow of information between various analyzers and control nodes, monitoring subsystems, and ensuring they receive the appropriate supply of electrical power. Tackling such complex tasks simultaneously (and with near-zero latency) demands immense processing power and faultless, error-free programming. Traditionally, a CSC would comprise a significant portion of the cost in a starships electronics systems, but the fullerene-based Sleeper designs have provided breakthroughs in the efficiency of circuitry and presented new and improved methods for increasing computational accuracy. The end result is a drastically reduced cost for top-of-the-line performance. \n','2889','0','0','0.01','0','1',NULL,'0','1','1148','0'),('30271','966','Emergent Combat Intelligence','Although emergent systems are not fully-fledged Artificial Intelligences, they are often so advanced that they can border on sentience. The means by which they are created is also a common source for claims that they are in fact, full-blown AIs. Emergent system development is said to have been an early focal point in Jovian software design, where they hoped to create an atmosphere in which an advanced system could self-assemble its own consciousness and thus emerge as a sentient being. What became of these projects remains unknown, although the Jovians appear to have abandoned these pursuits many millennia ago in favor of something more tangible and containable.\n\nDesigned from the ground up to perform complex, real-time combat calculations such as weapon tracking and heat optimization, this device shows the signatures of an emergent intelligence. Despite this, various hard limitations have been encoded into the device at the most fundamental level, greatly limiting its potential to evolve any further. Even in its current state though, it represents some of the most advanced combat electronics ever built. Although nothing about the software is in itself revolutionary, it is able to tackle highly complex tasks with a frightening level of speed and efficiency.','2889','0','0','0.01','0','1',NULL,'0','1','1148','0'),('30614','993','Intact Armor Nanobot','Recovered from amongst the debris of a Sleeper facility, this ancient device is somehow still entirely functional. Just one of these items holds countless nanoassemblers inside, offering a comprehensive view of the finer details in the Sleeper\'s defensive systems.\n\nPristine, working examples of Sleeper technology such as this are extremely rare and even more valuable. With the right skills and equipment, they can offer great insights into the scientific pursuits of the ancient race that designed them. ','3734','0','0','10','0','1',NULL,'0','1','1149','0'),('30615','993','Malfunctioning Armor Nanobot','Recovered from amongst the debris of a Sleeper facility, this ancient device is locked into a slow decline. Just one of these items holds countless nanoassemblers inside, offering a comprehensive view of the finer details in the Sleeper\'s defensive systems. Unfortunately, a great deal of the assemblers inside this one have fused together, causing a terminal chain reaction inside the device.\n\nEven though it is badly damaged, a skilled scientist could still possibly extract enough information to try and reverse engineer it. ','3734','0','0','10','0','1',NULL,'0','1','1149','0'),('30618','993','Wrecked Armor Nanobot','Recovered from amongst the debris of a Sleeper facility, this ancient device is almost entirely shut down. Just one of these items would normally hold countless nanoassemblers inside, offering a comprehensive view of the finer details in the Sleeper\'s defensive systems. Unfortunately, all of the assemblers inside this one have fused together, causing a terminal chain reaction inside the device.\n\nEven though it is only a shell of what it once used to be, with a bit of guesswork and luck, a skilled scientist might still be able to extract enough information to try and reverse engineer it. ','3734','0','0','10','0','1',NULL,'0','1','1149','0'),('30187','971','Intact Thruster Sections','Even after millennia of exposure to space, these thruster sections show barely any signs of mechanical wear and appear to be completely functional. The modular design of Sleeper propulsion systems is similar to that of the empires, but deviates in a few interesting areas.\n\nPristine, working examples of Sleeper technology such as this are extremely rare and even more valuable. With the right skills and equipment, they can offer great insights into the scientific pursuits of the ancient race that designed them. ','3738','0','0','10','0','1',NULL,'0','1','1149','0'),('30558','971','Malfunctioning Thruster Sections','After millennia of exposure to space, these thruster sections have begun to wear significantly, offering only a limited example of their full functionality. The modular design of Sleeper propulsion systems is still observable however, and is notably similar to that of the empires, only deviating in a few interesting areas.\n\nA determined and lucky researcher could still successfully reverse engineer something useful from this, but they would certainly stand a better chance with a more functional design. ','3738','0','0','10','0','1',NULL,'0','1','1149','0'),('30562','971','Wrecked Thruster Sections','Originally misidentified by the analyzers as nothing more than scrap, these ancient thruster sections are only marginally more than that. Whether it was centuries of radiation or some violent explosion countless years ago, these thrusters have been damaged long ago and are now in a state of advanced erosion as a result.\n\nThe modular design of the Sleeper propulsion systems appears to be similar to empire technology, with only slight deviations observable. Perhaps there are secrets to the Sleeper propulsion designs locked away inside these broken relics, but it would take a significant amount of luck for even a skilled researcher to successfully reverse engineer them and find out. ','3738','0','0','10','0','1',NULL,'0','1','1149','0'),('30582','992','Intact Power Cores','Rescued from a crumbling Sleeper structure, these ancient power cores stand as an excellent example of Sleeper engineering. Unlike everything else that surrounded them, these cores appeared to be almost newly-manufactured.\n\nPristine, working examples of Sleeper technology such as this are extremely rare and even more valuable. With the right skills and equipment, they can offer great insights into the scientific pursuits of the ancient race that designed them. ','3736','0','0','10','0','1',NULL,'0','1','1149','0'),('30586','992','Malfunctioning Power Cores ','Taken from amongst countless other ruined devices that cluttered the Sleeper facility once housing them, these ancient Sleeper power cores are still intact, yet extremely defective. Unlocking the technological secrets behind them would be a difficult task in their current state. Only those researchers who are skilled in reverse engineering would have a chance, and even then, not a great one. ','3736','0','0','10','0','1',NULL,'0','1','1149','0'),('30588','992','Wrecked Power Cores','These ancient power cores have all but succumbed to millennia of neglect and disuse. A few elements of their basic design remain intact, offering a skilled researcher some small hope that the secrets locked away inside may still be reverse engineered into something more functional.','3736','0','0','10','0','1',NULL,'0','1','1149','0'),('30599','990','Intact Electromechanical Component ','This ancient piece of electronics equipment is in near-perfect condition, untarnished by centuries of disuse. The design of the circuitry appears to be highly modular, offering a wide-ranging insight into Sleeper electronics systems.\n\nPristine, working examples of Sleeper technology such as this are extremely rare and even more valuable. With the right skills and equipment, they can offer great insights into the scientific pursuits of the ancient race that designed them. ','3735','0','0','10','0','1',NULL,'0','1','1149','0'),('30600','990','Malfunctioning Electromechanical Component','This ancient piece of electronics equipment has long since begun to malfunction. Despite centuries of disuse having taken a heavy toll on the device, the design of the circuitry remains clear enough to the form the basis of scientific study. A skilled researcher could have a decent chance at unlocking the secrets of Sleeper electronics design within. ','3735','0','0','10','0','1',NULL,'0','1','1149','0'),('30605','990','Wrecked Electromechanical Component','This ancient piece of electronics equipment has all but disintegrated after centuries of disuse. Much of the circuitry has been claimed by decay, leaving only the most fundamental information available for reverse engineering attempts. Even despite the low chance of success, in the hands of a skilled researcher these components could still help unlock the secrets of Sleeper electronics design.','3735','0','0','10','0','1',NULL,'0','1','1149','0'),('30628','991','Intact Weapon Subroutines','This collection of electronic devices represents the core of the computerized functionality behind the Sleeper weapons systems. An amalgam of advanced calibration and tracking devices, they are the driving force behind the frightening accuracy and efficiency of Sleeper armaments.\n\nThe subroutines have been coded into various devices which were then secreted away inside an ultra-hard metallofullerene alloy container. They show barely any sign of age, serving as an almost perfect example of Sleeper weapons design. \n\nPristine, working examples of Sleeper technology such as this are extremely rare and even more valuable. With the right skills and equipment, they can offer great insights into the scientific pursuits of the ancient race that designed them. ','3737','0','0','10','0','1',NULL,'0','1','1149','0'),('30632','991','Malfunctioning Weapon Subroutines','This collection of electronic devices represents the core of the computerized functionality behind the Sleeper weapons systems. An amalgam of advanced calibration and tracking devices, they are the driving force behind the frightening accuracy and efficiency of Sleeper armaments.\n\nThe subroutines have been coded into various devices which were then secreted away inside an ultra-hard metallofullerene alloy container. A small tear in the containers seal has exposed them to centuries of radiation however, leaving them barely functional.\n\nEven despite this, a skilled scientist could still possibly extract enough information to reverse engineer one. ','3737','0','0','10','0','1',NULL,'0','1','1149','0'),('30633','991','Wrecked Weapon Subroutines','This collection of electronic devices represents the core of the computerized functionality behind the Sleeper weapons systems. An amalgam of advanced calibration and tracking devices, they are the driving force behind the frightening accuracy and efficiency of Sleeper armaments.\n\nThe subroutines have been coded into various devices which were then stored inside the facility from which they came. Exposed to countless centuries of radiation after its walls began to erode, the subroutines are barely recognizable, offering only the most rudimentary glimpses into Sleeper weapons design. It would take a skilled researcher and a good amount of luck to successfully reverse engineer anything functional from such a broken mess. ','3737','0','0','10','0','1',NULL,'0','1','1149','0'),('30752','997','Intact Hull Section','Found drifting amongst the ruins of a Sleeper compound, these large sections of a Sleeper vessel represent a significant archaeological discovery. Not only is the hull itself an incredibly rare find, but the excellent condition it is in makes this a particularly useful case study for the Sleepers ship construction methods.\n\nPristine, working examples of Sleeper technology such as this are extremely rare and even more valuable. With the right skills and equipment, they can offer great insights into the scientific pursuits of the ancient race that designed them. ','3766','0','0','100','0','1',NULL,'0','1','1149','0'),('30753','997','Malfunctioning Hull Section','Found drifting amongst the ruins of a Sleeper compound, these large sections of a Sleeper vessel represent a significant archaeological discovery. The hull itself is an incredibly rare find, tainted only by the condition it is in. Although it was clearly built to survive the stress of space, the countless years of environmental exposure have still taken a heavy toll, stripping from it a great deal of the original functionality.\n\nEven despite the damage, it would still make a respectable case study for the Sleepers vessel construction methods. A skilled scientist could still possibly extract enough information to try and reverse engineer it. ','3766','0','0','100','0','1',NULL,'0','1','1149','0'),('30754','997','Wrecked Hull Section','Mistakenly identified by the analyzers as a derelict structure, these ancient Sleeper hull fragments are almost entirely destroyed. Whether slow erosion or some more rapid and violent event devastated the technology remains unclear. It is simply too badly damaged to make an educated guess.\n\nThere isnt much of a chance that anything useful could be reverse engineered from such badly ruined fragments, but there is little doubt that those few lucky researchers who successfully managed it would uncover the secrets to Sleeper hull designs. For many, that opportunity alone would be worth the gamble. ','3766','0','0','100','0','1',NULL,'0','1','1149','0');

DROP TABLE IF EXISTS `wcf1_user`;
CREATE TABLE `wcf1_user` (
  `userID` int(10) unsigned NOT NULL auto_increment,
  `username` varchar(255) NOT NULL default '',
  `email` varchar(255) NOT NULL default '',
  `password` varchar(40) NOT NULL default '',
  `salt` varchar(40) NOT NULL default '',
  `languageID` int(10) unsigned NOT NULL default '0',
  `registrationDate` int(10) unsigned NOT NULL default '0',
  `styleID` int(10) unsigned NOT NULL default '0',
  `activationCode` int(10) unsigned NOT NULL default '0',
  `registrationIpAddress` varchar(15) NOT NULL default '',
  `lastLostPasswordRequest` int(10) unsigned NOT NULL default '0',
  `lostPasswordKey` varchar(40) NOT NULL default '',
  `newEmail` varchar(255) NOT NULL default '',
  `reactivationCode` int(10) unsigned NOT NULL default '0',
  `oldUsername` varchar(255) NOT NULL default '',
  `lastUsernameChange` int(10) unsigned NOT NULL default '0',
  `quitStarted` int(10) unsigned NOT NULL default '0',
  `banned` tinyint(1) unsigned NOT NULL default '0',
  `banReason` mediumtext,
  `signature` text,
  `signatureCache` text,
  `enableSignatureSmilies` tinyint(1) NOT NULL default '1',
  `enableSignatureHtml` tinyint(1) NOT NULL default '0',
  `enableSignatureBBCodes` tinyint(1) NOT NULL default '1',
  `disableSignature` tinyint(1) NOT NULL default '0',
  `disableSignatureReason` text,
  `rankID` int(10) unsigned NOT NULL default '0',
  `userTitle` varchar(255) NOT NULL default '',
  `activityPoints` int(10) unsigned NOT NULL default '0',
  `avatarID` int(10) unsigned NOT NULL default '0',
  `disableAvatar` tinyint(1) NOT NULL default '0',
  `lastActivityTime` int(10) unsigned NOT NULL default '0',
  `profileHits` int(10) unsigned NOT NULL default '0',
  `pmTotalCount` int(10) unsigned NOT NULL default '0',
  `pmUnreadCount` int(10) unsigned NOT NULL default '0',
  `pmOutstandingNotifications` int(10) unsigned NOT NULL default '0',
  `userOnlineGroupID` int(10) unsigned NOT NULL default '0',
  PRIMARY KEY  (`userID`),
  KEY `username` (`username`),
  KEY `activationCode` (`activationCode`),
  KEY `registrationIpAddress` (`registrationIpAddress`,`registrationDate`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

