DROP TABLE IF EXISTS `z_pricing`;
CREATE TABLE `z_pricing` (
  `typeID` smallint(6) NOT NULL,
  `marketGroupID` smallint(6) NOT NULL,
  `dPrice` double default '0',
  `dLowerQuartile` double default '0',
  `dMedian` double default '0',
  `dUpperQuartile` double default '0',
  `dAverage` double default '0',
  `dRealAverage` double default '0',
  `dStandardDeviation` double default '0',
  `dMinimum` double default '0',
  `dMaximum` double default '0',
  `dCustomMinimum` double default '0',
  `dCustomMaximum` double default '0',
  `iCount` int(10) default '0',
  `iTimestamp` int(16) default '0',
  PRIMARY KEY  (`typeID`,`marketGroupID`),
  KEY `price` (`dPrice`),
  KEY `median25` (`dLowerQuartile`),
  KEY `median50` (`dMedian`),
  KEY `median75` (`dUpperQuartile`),
  KEY `avg` (`dAverage`),
  KEY `stddev` (`dStandardDeviation`),
  KEY `min` (`dMinimum`),
  KEY `max` (`dMaximum`),
  KEY `user_min` (`dCustomMinimum`),
  KEY `user_max` (`dCustomMaximum`),
  KEY `count` (`iCount`),
  KEY `timestamp` (`iTimestamp`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

